function updateTradingViewChart(symbol) {
    if (!tradingViewChartContainer) return;
    tradingViewChartContainer.innerHTML = '';
    const script = document.createElement('script');
    script.type = 'text/javascript';
    script.src = 'https://s3.tradingview.com/external-embedding/embed-widget-advanced-chart.js';
    script.async = true;
    script.innerHTML = JSON.stringify({
        "autosize": true,
        "symbol": symbol,
        "interval": "D",
        "timezone": "Etc/UTC",
        "theme": "dark",
        "style": "1",
        "locale": "en",
        "enable_publishing": false,
        "backgroundColor": "rgb(10, 9, 9)",
        "gridColor": "rgba(240, 243, 250, 0)",
        "withdateranges": true,
        "hide_side_toolbar": false,
        "allow_try_chart": true,
        "hotlist": false,
        "calendar": false,
        "studies": ["Volume@tv-basicstudies"],
        "container_id": "tradingview-chart-container"
    });
    tradingViewChartContainer.appendChild(script);
}

// --- Fetch all coins from backend and populate dropdowns (Spot Trade) ---
async function fetchAndPopulateCoins() {
    try {
        const response = await fetch(`${BASE_URL}/api/market/coins/all`);
        if (!response.ok) throw new Error(`HTTP error! status: ${response.status}`);
        
        const data = await response.json();
        allAvailableCoins = data; // allAvailableCoins now holds all USDT pairs from backend
        console.log('Fetched allAvailableCoins (all USDT pairs from backend):', allAvailableCoins.length, 'coins');

        // ++ Filter allAvailableCoins by the CURATED_BINANCE_SYMBOLS list for display ++
        const filteredCoinsForDisplay = allAvailableCoins.filter(coin => 
            CURATED_BINANCE_SYMBOLS.includes(coin.symbol.toUpperCase())
        );
        filteredCoinsForDisplay.sort((a, b) => a.symbol.localeCompare(b.symbol));

        // Populate Coin Selector for "Trade Crypto"
        coinSelector.innerHTML = '';
        const defaultOptionSpot = document.createElement('option');
        defaultOptionSpot.value = "";
        defaultOptionSpot.textContent = "Select a Crypto or Asset";
        coinSelector.appendChild(defaultOptionSpot);

        const cryptoOptgroupSpot = document.createElement('optgroup');
        cryptoOptgroupSpot.label = "Cryptocurrencies";
        filteredCoinsForDisplay.forEach(coin => { // Use the filtered list for population
            const option = document.createElement('option');
            option.value = coin.symbol.toUpperCase(); 
            option.textContent = `${coin.name} (${coin.symbol.toUpperCase()})`;
            option.dataset.type = "crypto";
            option.dataset.tradingviewSymbol = `BINANCE:${coin.symbol.toUpperCase()}USDT`; 
            cryptoOptgroupSpot.appendChild(option);
        });
        coinSelector.appendChild(cryptoOptgroupSpot);

        const nonCryptoOptgroupSpot = document.createElement('optgroup');
        nonCryptoOptgroupSpot.label = "Commodities & Forex";
        nonCryptoAssets.forEach(asset => {
            const option = document.createElement('option');
            option.value = asset.id;
            option.textContent = asset.name;
            option.dataset.type = asset.type;
            option.dataset.tradingviewSymbol = asset.symbol;
            nonCryptoOptgroupSpot.appendChild(option);
        });
        coinSelector.appendChild(nonCryptoOptgroupSpot);

        // Set initial selection for "Trade Crypto"
        const defaultCrypto = filteredCoinsForDisplay.find(coin => coin.symbol.toUpperCase() === "BTC");
        if (defaultCrypto) {
            coinSelector.value = "BTC"; 
            currentSelectedBinanceSymbol = "BTC"; 
            currentSelectedTradingViewSymbol = `BINANCE:${defaultCrypto.symbol.toUpperCase()}USDT`; 
            updateSpotCryptoInfo("BTC"); 
            updateTradingViewChart(currentSelectedTradingViewSymbol);
            enableSpotCryptoTradeFeatures();
        } else {
            disableSpotCryptoTradeFeatures();
        }

    } catch (error) {
        console.error("Error fetching coins for Spot Trade:", error);
        coinSelector.innerHTML = '<option value="">Error loading coins</option>';
    }
    
    await fetchCryptoPricesForConverter(); 
}

function enableSpotCryptoTradeFeatures() {
    if (currentPriceInfoDiv) currentPriceInfoDiv.style.display = 'block';
    if (amountInput) amountInput.style.display = 'block';
    if (buyButton) buyButton.style.display = 'block';
    if (sellButton) sellButton.style.display = 'block';
    if (amountInput) amountInput.disabled = false;
    if (buyButton) buyButton.disabled = false;
    if (sellButton) sellButton.disabled = false;
    if (cryptoCalculationDisplay) cryptoCalculationDisplay.style.display = 'block';
}

function disableSpotCryptoTradeFeatures() {
    if (currentPriceInfoDiv) currentPriceInfoDiv.style.display = 'none';
    if (amountInput) amountInput.style.display = 'none';
    if (buyButton) buyButton.style.display = 'none';
    if (sellButton) sellButton.style.display = 'none';
    if (amountInput) amountInput.disabled = true;
    if (buyButton) buyButton.disabled = true;
    if (sellButton) sellButton.disabled = true;
    if (cryptoCalculationDisplay) cryptoCalculationDisplay.style.display = 'none';
    calculatedCryptoAmount.textContent = '0.00';
    calculatedCryptoSymbol.textContent = '';
    amountInput.value = '';
}

async function updateSpotCryptoInfo(binanceSymbol) {
    const coin = allAvailableCoins.find(c => c.symbol.toUpperCase() === binanceSymbol.toUpperCase());
    if (coin) {
        currentPriceDisplay.textContent = `$${coin.current_price.toLocaleString(undefined, { minimumFractionDigits: 2, maximumFractionDigits: 6 })}`;
        currentSelectedTradingViewSymbol = `BINANCE:${coin.symbol.toUpperCase()}USDT`;
        updateTradingViewChart(currentSelectedTradingViewSymbol);
        calculatedCryptoSymbol.textContent = coin.symbol ? coin.symbol.toUpperCase() : '';
        if (amountInput.value) calculateCryptoAmount();
    } else {
        currentPriceDisplay.textContent = 'N/A';
    }
}

function calculateCryptoAmount() {
    const amountUSD = parseFloat(amountInput.value);
    const selectedCoin = allAvailableCoins.find(coin => coin.symbol.toUpperCase() === currentSelectedBinanceSymbol.toUpperCase());
    if (selectedCoin && selectedCoin.current_price && !isNaN(amountUSD) && amountUSD > 0) {
        const cryptoAmount = amountUSD / selectedCoin.current_price;
        calculatedCryptoAmount.textContent = cryptoAmount.toLocaleString(undefined, { minimumFractionDigits: 2, maximumFractionDigits: 8 });
    } else {
        calculatedCryptoAmount.textContent = '0.00';
    }
}

function showLoading(show) {
    if (loadingOverlay) loadingOverlay.style.display = show ? 'flex' : 'none';
}

async function fetchCryptoPricesForConverter() {
    showLoading(true);
    try {
        const tempCryptoPrices = {};
        const updatedConverterCurrencies = [];

        updatedConverterCurrencies.push({
            id: 'USD',
            symbol: 'USD',
            name: 'United States Dollar',
            current_price: 1
        });
        tempCryptoPrices['USD'] = 1;

        // ++ Filter allAvailableCoins by CURATED_BINANCE_SYMBOLS for the converter ++
        const filteredCoinsForConverter = allAvailableCoins.filter(coin =>
            CURATED_BINANCE_SYMBOLS.includes(coin.symbol.toUpperCase())
        );

        filteredCoinsForConverter.forEach(coin => { // Iterate over filtered list
            if (coin.current_price !== undefined && coin.current_price !== null) {
                const coinBinanceSymbol = coin.symbol.toUpperCase();
                updatedConverterCurrencies.push({
                    id: coinBinanceSymbol,
                    symbol: coinBinanceSymbol,
                    name: coin.name,
                    current_price: parseFloat(coin.current_price)
                });
                tempCryptoPrices[coinBinanceSymbol] = parseFloat(coin.current_price);
            } else {
                console.warn(`Price for ${coin.symbol} not available for converter.`); 
                updatedConverterCurrencies.push({
                    id: coin.symbol.toUpperCase(), 
                    symbol: coin.symbol.toUpperCase(),
                    name: coin.name,
                    current_price: 0 
                });
                tempCryptoPrices[coin.symbol.toUpperCase()] = 0;
            }
        });
        
        // Ensure USDT (Tether) price is 1 if not explicitly fetched or overridden, and it's in curated list
        if (CURATED_BINANCE_SYMBOLS.includes('USDT') && !tempCryptoPrices['USDT']) {
             tempCryptoPrices['USDT'] = 1.00;
             const usdtEntry = updatedConverterCurrencies.find(c => c.symbol === 'USDT');
             if (!usdtEntry) {
                 updatedConverterCurrencies.push({
                     id: 'USDT', symbol: 'USDT', name: 'Tether', current_price: 1.00
                 });
             } else {
                 usdtEntry.current_price = 1.00;
             }
        }


        converterCurrencies = updatedConverterCurrencies; 
        cryptoPrices = tempCryptoPrices;
        console.log("Updated 'converterCurrencies' for converter:", converterCurrencies); 
        console.log("Updated 'cryptoPrices' map:", cryptoPrices); 

    } catch (error) {
        console.error("Error populating converter prices:", error);
        showMessage("Failed to set up converter prices. Using cached data if available.", "error");
    } finally {
        showLoading(false);
        populateInstantCurrencyDropdowns(); 
        updateInstantCurrencyDisplays();
        calculateInstantConversion(issuedAmountInput);
    }
}

function populateInstantCurrencyDropdowns() {
    const currentIssued = issuedCurrencyDropdown.value;
    const currentObtained = obtainedCurrencyDropdown.value;
    issuedCurrencyDropdown.innerHTML = '';
    obtainedCurrencyDropdown.innerHTML = '';

    // Sort the filtered list and populate
    const sortedCryptos = [...converterCurrencies].sort((a, b) => a.symbol.localeCompare(b.symbol));
    sortedCryptos.forEach(crypto => {
        const issuedOption = document.createElement('option');
        issuedOption.value = crypto.symbol; 
        issuedOption.textContent = crypto.symbol;
        issuedCurrencyDropdown.appendChild(issuedOption);

        const obtainedOption = document.createElement('option');
        obtainedOption.value = crypto.symbol; 
        obtainedOption.textContent = crypto.symbol;
        obtainedCurrencyDropdown.appendChild(obtainedOption);
    });

    issuedCurrencyDropdown.value = currentIssued || 'USDT'; 
    obtainedCurrencyDropdown.value = currentObtained || 'ETH'; 

    if (!issuedCurrencyDropdown.querySelector('option[value="USD"]')) {
        const usdOptionIssued = document.createElement('option');
        usdOptionIssued.value = 'USD';
        usdOptionIssued.textContent = 'USD';
        issuedCurrencyDropdown.prepend(usdOptionIssued); 
    }
    if (!obtainedCurrencyDropdown.querySelector('option[value="USD"]')) {
        const usdOptionObtained = document.createElement('option');
        usdOptionObtained.value = 'USD';
        usdOptionObtained.textContent = 'USD';
        obtainedCurrencyDropdown.prepend(usdOptionObtained); 
    }
}

async function updateInstantCurrencyDisplays() {
    const issuedSymbol = issuedCurrencyDropdown.value; 
    const obtainedSymbol = obtainedCurrencyDropdown.value; 

    // Find the logo from cryptoLogoMap, default to empty string if not found
    const issuedLogoSrc = cryptoLogoMap[issuedSymbol.toUpperCase()] || '';
    const obtainedLogoSrc = cryptoLogoMap[obtainedSymbol.toUpperCase()] || '';

    // Update issued currency display
    issuedCurrencySymbolDisplay.textContent = issuedSymbol.toUpperCase();
    issuedCurrencyLogoDisplay.src = issuedLogoSrc;
    issuedCurrencyLogoDisplay.alt = issuedSymbol.toUpperCase() + ' Symbol';

    // Update obtained currency display
    obtainedCurrencySymbolDisplay.textContent = obtainedSymbol.toUpperCase();
    obtainedCurrencyLogoDisplay.src = obtainedLogoSrc;
    obtainedCurrencyLogoDisplay.alt = obtainedSymbol.toUpperCase() + ' Symbol';
    
    await fetchAndDisplayInstantBalance(issuedSymbol); 
}

function calculateInstantConversion(triggeringInput) {
    const issuedSymbol = issuedCurrencyDropdown.value;
    const obtainedSymbol = obtainedCurrencyDropdown.value;
    const issuedAmount = parseFloat(issuedAmountInput.value);

    const issuedPrice = cryptoPrices[issuedSymbol.toUpperCase()]; 
    const obtainedPrice = cryptoPrices[obtainedSymbol.toUpperCase()]; 

    console.log(`Instant Conversion Calculation: Issued Symbol: ${issuedSymbol} @ $${issuedPrice}, Obtained Symbol: ${obtainedSymbol} @ $${obtainedPrice}, Issued Amount: ${issuedAmount}`); 

    if (!issuedPrice || !obtainedPrice || issuedSymbol === obtainedSymbol) {
        if (triggeringInput === issuedAmountInput) obtainedAmountInput.value = '';
        else issuedAmountInput.value = '';
        tradeRateValue.textContent = 'N/A';
        rateBaseSymbol.textContent = issuedSymbol.toUpperCase();
        rateTargetSymbol.textContent = obtainedSymbol.toUpperCase();
        instantTradeConverterButton.disabled = true; 
        return;
    }

    const rate = issuedPrice / obtainedPrice;
    tradeRateValue.textContent = rate.toLocaleString(undefined, { minimumFractionDigits: 8, maximumFractionDigits: 8 });
    rateBaseSymbol.textContent = issuedSymbol.toUpperCase();
    rateTargetSymbol.textContent = obtainedSymbol.toUpperCase();
    instantTradeConverterButton.disabled = false; 

    if (triggeringInput === issuedAmountInput) {
        if (!isNaN(issuedAmount) && issuedAmount >= 0) {
            const obtainedAmount = issuedAmount * rate;
            obtainedAmountInput.value = obtainedAmount.toFixed(8);
        } else {
            issuedAmountInput.value = '';
        }
    } else if (triggeringInput === obtainedAmountInput) {
        const obtainedAmount = parseFloat(obtainedAmountInput.value);
        if (!isNaN(obtainedAmount) && obtainedAmount >= 0) {
            const issuedAmountCalculated = obtainedAmount / rate; 
            issuedAmountInput.value = issuedAmountCalculated.toFixed(8);
        } else {
            issuedAmountInput.value = '';
        }
    }
}

function swapInstantCurrencies() {
    const currentIssuedSymbol = issuedCurrencyDropdown.value;
    const currentObtainedSymbol = obtainedCurrencyDropdown.value;
    
    issuedCurrencyDropdown.value = currentObtainedSymbol;
    obtainedCurrencyDropdown.value = currentIssuedSymbol;
    
    updateInstantCurrencyDisplays();
    calculateInstantConversion(issuedAmountInput); 
}

function switchTradeMode(mode) {
    spotCryptoTradeView.classList.add('hidden');
    instantSpotTradeView.classList.add('hidden');
    sellFromAssetsView.classList.add('hidden'); 
    if (tradingViewChartContainer) tradingViewChartContainer.style.display = 'none';

    spotCryptoTab.classList.remove('active');
    instantSpotTab.classList.remove('active');
    sellFromAssetsTab.classList.remove('active'); 

    if (mode === 'spotCrypto') {
        spotCryptoTab.classList.add('active');
        spotCryptoTradeView.classList.remove('hidden');
        if (tradingViewChartContainer) tradingViewChartContainer.style.display = 'block';
    } else if (mode === 'instantSpot') {
        instantSpotTab.classList.add('active');
        instantSpotTradeView.classList.remove('hidden');
        if (converterCurrencies.length === 0 || Object.keys(cryptoPrices).length === 0) {
            fetchCryptoPricesForConverter();
        } else {
            updateInstantCurrencyDisplays();
            calculateInstantConversion(issuedAmountInput);
        }
    } else if (mode === 'sellFromAssets') { 
        sellFromAssetsTab.classList.add('active');
        sellFromAssetsView.classList.remove('hidden');
        fetchUserAssetsAndPopulateSelector(); 
    }
}

async function fetchAndDisplayInstantBalance(currencySymbol = null) { 
    console.log('Fetching user assets and updating balances...'); 
    try {
        const response = await fetch(`${BASE_URL}/api/wallet`, {
            method: 'GET',
            headers: { 'Authorization': `Bearer ${token}` }
        });
        const walletData = await response.json();
        console.log('Wallet Data received for asset population:', walletData); 

        if (response.ok) {
            userAssets.clear(); // Clear the Map
            if (walletData.assets && walletData.assets.length > 0) {
                walletData.assets.forEach(asset => {
                    userAssets.set(asset.symbol.toUpperCase(), asset.amount); // Use Map.set()
                });
            }
            userAssets.set('USD', walletData.balanceUSD); // Use Map.set()

            console.log('Populated userAssets for instant trade/sell from assets:', userAssets);

            if (currencySymbol && instantAvailableBalanceDisplay) {
                const availableAmount = userAssets.get(currencySymbol.toUpperCase()) || 0; // Use Map.get()
                instantAvailableBalanceDisplay.textContent = availableAmount.toFixed(6);
                console.log(`Instant Balance Display: Attempted to display balance for symbol: ${currencySymbol.toUpperCase()}, Amount: ${availableAmount.toFixed(6)}`); 
            } else {
                instantAvailableBalanceDisplay.textContent = '0.000000'; 
                console.log('Instant Balance Display: No specific currency symbol provided or currencySymbol is null.'); 
            }

            assetToSellSelector.innerHTML = '<option value="">Select an asset</option>';
            let hasAssetsToDisplay = false;

            if (userAssets.has('USD') && userAssets.get('USD') > 0) { // Use Map.has() and Map.get()
                const usdOption = document.createElement('option');
                usdOption.value = 'USD'; 
                usdOption.textContent = `USD ($${userAssets.get('USD').toFixed(2)})`; // Use Map.get()
                assetToSellSelector.appendChild(usdOption);
                hasAssetsToDisplay = true;
            }

            // ++ Logic for populating Sell from Assets dropdown ++
            // We want to show all assets the user holds, regardless of CURATED_BINANCE_SYMBOLS
            if (walletData.assets && walletData.assets.length > 0) {
                // Sort assets alphabetically by symbol for a cleaner display
                walletData.assets.sort((a, b) => a.symbol.localeCompare(b.symbol));
                walletData.assets.forEach(asset => {
                    if (asset.amount > 0) { 
                        const option = document.createElement('option');
                        option.value = asset.symbol.toUpperCase(); 
                        option.textContent = `${asset.symbol.toUpperCase()} (${asset.amount.toFixed(6)}) - $${asset.usdValue.toFixed(2)}`;
                        assetToSellSelector.appendChild(option);
                        hasAssetsToDisplay = true;
                    }
                });
            }

            if (!hasAssetsToDisplay) {
                assetToSellSelector.innerHTML = '<option value="">No assets to sell</option>';
                assetToSellSelector.disabled = true;
            } else {
                assetToSellSelector.disabled = false;
            }

            updateSellAssetInfo(); 

        } else {
            showMessage(`Error fetching user assets: ${walletData.message || 'Failed to load assets.'}`, 'error');
            console.error('Error fetching user assets for trade page:', walletData.message); 
            assetToSellSelector.innerHTML = '<option value="">Error loading assets</option>';
            assetToSellSelector.disabled = true;
        }
    } catch (error) {
        showMessage(`Network error fetching user assets: ${error.message}`, 'error');
        console.error('Network error fetching user assets:', error); 
        assetToSellSelector.innerHTML = '<option value="">Error loading assets</option>';
        assetToSellSelector.disabled = true;
    }
}

async function fetchUserAssetsAndPopulateSelector() {
    console.log('fetchUserAssetsAndPopulateSelector called (redirecting to fetchAndDisplayInstantBalance)'); 
    await fetchAndDisplayInstantBalance(); 
}

async function updateSellAssetInfo() {
    const selectedBinanceSymbol = assetToSellSelector.value;
    const quantityToSell = parseFloat(sellAssetQuantityInput.value);

    console.log('updateSellAssetInfo called. Selected:', selectedBinanceSymbol, 'Quantity:', quantityToSell);

    if (!selectedBinanceSymbol || isNaN(quantityToSell) || quantityToSell <= 0) {
        currentSelectedAssetBalance.textContent = '0.00';
        currentSelectedAssetSymbol.textContent = '';
        receivedUsdAmountDisplay.textContent = '0.00';
        confirmSellAssetButton.disabled = true;
        console.log('Sell Asset Info: No asset selected or invalid quantity. Resetting displays.'); 
        return;
    }

    const assetBalanceLookupKey = selectedBinanceSymbol.toUpperCase(); 
    const assetBalance = userAssets.get(assetBalanceLookupKey) || 0; // Use Map.get()
    console.log(`Sell Asset Info: Looking up balance for key '${assetBalanceLookupKey}'. Found: ${assetBalance}`); 

    currentSelectedAssetBalance.textContent = assetBalance.toFixed(8);

    let currentPriceUSD;
    let displaySymbol = selectedBinanceSymbol.toUpperCase(); 

    if (selectedBinanceSymbol === 'USD') {
        currentPriceUSD = 1.0;
        displaySymbol = 'USD';
    } else {
        const coin = allAvailableCoins.find(c => c.symbol.toUpperCase() === selectedBinanceSymbol.toUpperCase());
        if (coin) {
            currentPriceUSD = coin.current_price;
            displaySymbol = coin.symbol.toUpperCase();
        } else {
            currentPriceUSD = 0; 
            console.warn(`Price data not found for ${selectedBinanceSymbol} for sell calculation.`); 
        }
    }

    currentSelectedAssetSymbol.textContent = displaySymbol;

    if (currentPriceUSD > 0 && !isNaN(quantityToSell) && quantityToSell > 0) {
        const receivedUSD = quantityToSell * currentPriceUSD;
        receivedUsdAmountDisplay.textContent = receivedUSD.toLocaleString(undefined, { minimumFractionDigits: 2, maximumFractionDigits: 8 });
        
        if (quantityToSell > assetBalance) {
            confirmSellAssetButton.disabled = true;
            showMessage(`Insufficient ${displaySymbol} balance. You have ${assetBalance.toFixed(6)} available.`, 'error');
            console.log(`Sell Asset Info: Insufficient balance. Requested: ${quantityToSell}, Available: ${assetBalance}`); 
        } else {
            confirmSellAssetButton.disabled = false;
            console.log(`Sell Asset Info: Sufficient balance. Button enabled.`); 
        }
    } else {
        receivedUsdAmountDisplay.textContent = '0.00';
        confirmSellAssetButton.disabled = true;
        console.log('Sell Asset Info: Current price invalid or quantity invalid. Disabling button.'); 
    }
}


// --- Event Listeners ---
document.addEventListener("DOMContentLoaded", async () => {
    await fetchAndPopulateCoins();
    await fetchAndDisplayInstantBalance(); 
    switchTradeMode('spotCrypto'); 

    socket.on('realtime-price-update', (updatedCoinsData) => { 
        if (!updatedCoinsData || updatedCoinsData.length === 0) return;
        updatedCoinsData.forEach(updatedCoin => {
            const index = allAvailableCoins.findIndex(coin => coin.symbol.toUpperCase() === updatedCoin.symbol.toUpperCase());
            if (index !== -1) {
                allAvailableCoins[index].current_price = updatedCoin.current_price;
            } else {
                allAvailableCoins.push(updatedCoin);
            }
        });
        
        if (!spotCryptoTradeView.classList.contains('hidden')) {
            const selectedOption = coinSelector.options[coinSelector.selectedIndex];
            if (currentSelectedBinanceSymbol && selectedOption && selectedOption.dataset.type === 'crypto') {
                updateSpotCryptoInfo(currentSelectedBinanceSymbol);
            }
        }
        if (!instantSpotTradeView.classList.contains('hidden')) {
            updatedCoinsData.forEach(coin => {
                cryptoPrices[coin.symbol.toUpperCase()] = parseFloat(coin.current_price);
            });
            calculateInstantConversion(issuedAmountInput); 
        }
    });

    socket.on('realtime-price-update-error', (message) => console.error("Real-time update error:", message));

    socket.on('connect', () => {
        console.log('Connected to WebSocket server for trade updates.');
    });

    socket.on('disconnect', () => {
        console.log('Disconnected from WebSocket server.');
    });

    socket.on('error', (error) => {
        console.error('Socket error:', error);
        showMessage('Real-time connection error.', 'error');
    });
});

