buyButton.addEventListener('click', () => {
    const token = localStorage.getItem('token');
    if (!token) {
        showMessage("Please log in to trade.");
        return window.location.href = 'login.html';
    }
    const amountUSD = parseFloat(amountInput.value); // This is the amount of USDT to spend
    if (!currentSelectedBinanceSymbol || isNaN(amountUSD) || amountUSD <= 0) {
        return showMessage("Please select a crypto and enter a valid amount to buy.");
    }
    const coin = allAvailableCoins.find(c => c.symbol.toUpperCase() === currentSelectedBinanceSymbol.toUpperCase());
    if (!coin || !coin.current_price) return showMessage("Price data not available.");
    
    const quantity = amountUSD / coin.current_price; // Quantity of crypto to receive
    
    // ++ IMPORTANT: Change endpoint to /api/trade and add tradeType ++
    fetch(`${BASE_URL}/api/trade`, { // Changed endpoint from /api/trade/buy to /api/trade
        method: 'POST',
        headers: { 'Content-Type': 'application/json', 'Authorization': `Bearer ${token}` },
        body: JSON.stringify({ 
            coinId: currentSelectedBinanceSymbol, 
            amount: amountUSD, // This 'amount' is the USDT spent
            quantity: quantity,
            tradeType: 'buy' // Explicitly send tradeType as 'buy'
        })
    })
     .then(response => { 
         if (!response.ok) {
             return response.json().then(err => { throw new Error(err.message || 'Buy order failed'); });
         }
         return response.json();
     })
     .then(data => {
        showMessage(`Spot Buy successful! ${data.message || ''}`, 'success'); 
        amountInput.value = '';
        calculatedCryptoAmount.textContent = '0.00';
        fetchAndDisplayInstantBalance(); 
    })
    .catch(error => showMessage(`Error placing Spot Buy order: ${error.message}`, 'error')); 
});

confirmSellAssetButton.addEventListener('click', async () => {
    const token = localStorage.getItem('token');
    if (!token) {
        showMessage("Please log in to sell assets.", 'error');
        return window.location.href = 'login.html';
    }

    const selectedBinanceSymbol = assetToSellSelector.value;
    const quantityToSell = parseFloat(sellAssetQuantityInput.value);

    console.log('Confirm Sell Asset Clicked:', { selectedBinanceSymbol, quantityToSell });

    if (!selectedBinanceSymbol || isNaN(quantityToSell) || quantityToSell <= 0) {
        return showMessage("Please select an asset and enter a valid quantity to sell.", 'error');
    }

    const assetBalanceLookupKey = selectedBinanceSymbol.toUpperCase(); 
    const availableBalance = userAssets.get(assetBalanceLookupKey) || 0; // Use Map.get()
    console.log(`Sell Asset: Balance check for ${selectedBinanceSymbol.toUpperCase()}: Available ${availableBalance}, Trying to sell ${quantityToSell}`);

    if (quantityToSell > availableBalance) {
        return showMessage(`You do not have enough of this asset to sell the specified quantity. You have ${availableBalance.toFixed(6)} available.`, 'error');
    }

    let coinPriceUSD;
    if (selectedBinanceSymbol === 'USD') {
        currentPriceUSD = 1.0;
    } else {
        const coin = allAvailableCoins.find(c => c.symbol.toUpperCase() === selectedBinanceSymbol.toUpperCase());
        if (coin) {
            currentPriceUSD = coin.current_price;
        } else {
            currentPriceUSD = 0; 
            console.warn(`Price data not found for ${selectedBinanceSymbol} for sell calculation.`); 
        }
    }
    if (!currentPriceUSD || currentPriceUSD <= 0) {
        return showMessage("Price data not available for this asset. Cannot sell.", 'error');
    }

    const amountUSD = quantityToSell * currentPriceUSD;

    console.log('Sending Sell Asset Request:', { coinId: selectedBinanceSymbol, amount: amountUSD, quantity: quantityToSell, tradeType: 'sell' });

    try {
        const response = await fetch(`${BASE_URL}/api/trade`, { // Endpoint remains /api/trade for sell
            method: 'POST',
            headers: { 'Content-Type': 'application/json', 'Authorization': `Bearer ${token}` },
            body: JSON.stringify({
                coinId: selectedBinanceSymbol,
                amount: amountUSD, // This 'amount' is the USDT received from selling
                quantity: quantityToSell, 
                tradeType: 'sell' // Explicitly send tradeType as 'sell'
            })
        });

        if (!response.ok) {
            const err = await response.json();
            throw new Error(err.message || 'Sell asset trade failed');
        }

        const data = await response.json();
        showMessage(`Sell order successful! ${data.message || ''}`, 'success');
        sellAssetQuantityInput.value = '';
        receivedUsdAmountDisplay.textContent = '0.00';
        confirmSellAssetButton.disabled = true; 
        await fetchAndDisplayInstantBalance(); 
    } catch (error) {
        showMessage(`Error selling asset: ${error.message}`, 'error');
        console.error('Sell asset error:', error); 
    }
});

instantTradeConverterButton.addEventListener('click', async () => {
    const token = localStorage.getItem('token');
    if (!token) {
        showMessage("Please log in to trade.", 'error'); 
        return window.location.href = 'login.html';
    }

    const issuedAmount = parseFloat(issuedAmountInput.value);
    const obtainedAmount = parseFloat(obtainedAmountInput.value);
    const issuedCurrencySymbol = issuedCurrencyDropdown.value; 
    const obtainedCurrencySymbol = obtainedCurrencyDropdown.value; 

    console.log('Instant Trade Button Clicked:', { issuedCurrencySymbol, issuedAmount, obtainedCurrencySymbol, obtainedAmount });

    if (!issuedCurrencySymbol || !obtainedCurrencySymbol || issuedCurrencySymbol === obtainedCurrencySymbol) {
        return showMessage("Please select valid and different currencies for trade.", 'error');
    }
    if (isNaN(issuedAmount) || issuedAmount <= 0 || isNaN(obtainedAmount) || obtainedAmount <= 0) {
        return showMessage("Please enter valid amounts for the instant trade.", 'error');
    }

    const availableBalance = userAssets.get(issuedCurrencySymbol.toUpperCase()) || 0; // Use Map.get()
    console.log(`Instant Trade: Balance check for ${issuedCurrencySymbol.toUpperCase()}: Available ${availableBalance}, Trying to issue ${issuedAmount}`);

    if (issuedAmount > availableBalance) {
        return showMessage(`Insufficient ${issuedCurrencySymbol.toUpperCase()} balance. You have ${availableBalance.toFixed(6)} available.`, 'error');
    }

    try {
        const response = await fetch(`${BASE_URL}/api/trade/instant`, {
            method: 'POST',
            headers: { 'Content-Type': 'application/json', 'Authorization': `Bearer ${token}` },
            body: JSON.stringify({
                issuedCurrency: issuedCurrencySymbol, 
                issuedAmount: issuedAmount,
                obtainedCurrency: obtainedCurrencySymbol, 
                obtainedAmount: obtainedAmount
            })
        });
        if (!response.ok) {
            const err = await response.json();
            throw new Error(err.message || 'Instant trade failed');
        }
        const data = await response.json();
        showMessage(`Instant Trade successful! ${data.message || ''}`, 'success');
        issuedAmountInput.value = '';
        obtainedAmountInput.value = '';
        await fetchAndDisplayInstantBalance(issuedCurrencySymbol); 
        updateInstantCurrencyDisplays(); 
    } catch (error) {
        showMessage(`Error performing Instant Trade: ${error.message}`, 'error');
        console.error('Instant Trade error:', error); 
    }
});
